import renderImage from "app/tile/handlers/renderImage"

export function register(server, config, next) {
  server.route([
    {
      method: "GET",
      path: "/{reportId}/{viewId}/{z}/{x}/{y}.png",
      handler: renderImage
    }
  ])
  next()
}

register.attributes = {
  name: "agridash-tile"
}
